  }*/
 //const setLeague = () => {console.log("this"+{league_id})}

	return ( <div  className={s.item} key={props.league_id}>
                {props.league_name}

                {league}
                <NavLink to={"/leagueschedule/"+props.league_id+"/"+props.period} >   Расписание лиги</NavLink>
                <NavLink to={"/teams/"+props.league_id+"/"+props.period} onClick={e => setLeague(e.target.value)}>        Список команд</NavLink>
           </div>      
	)  
}

